OWASP puts out a Password Storage Cheat Sheet , which at time of writing lists the following order of preferences: Argon2id with minimum 19 MiB memory, two iterations, and one degree of parallelism Scrypt with a memory cost parameter of 217, block size of 8, and 1 degree of parallelism Bcrypt with a minimum work factor of 10 and a password limit of 72 bytes If FIPS-140 compliance is required, PBKDF2 with a minimum work factor of 600,000 and a SHA-256 internal hash function You don't need to worry about setting these parameters; the default implementations match the recommendations. # fn main() {
use argon2::{Argon2, PasswordHasher, PasswordVerifier, password_hash::Salt}; let password = "password"; // This is the b64 hash of "bad salt!" for demo only: don't do this! Instead use:
// let salt = SaltString::generate(&mut OsRng);
let salt_str = "YmFkIHNhbHQh";
let salt: Salt = salt_str.try_into().unwrap(); let argon2 = Argon2::default();
let hash = argon2.hash_password(password.as_bytes(), salt).unwrap(); // This is the hash we will store. Notice our salt string is included, as well as parameters:
// version 0x13 (19), memory 19456KiB (19 MiB), 2 iterations (time), parallelism 1
let expected = "$argon2id$v=19$m=19456,t=2,p=1$YmFkIHNhbHQh$DqHGwv6NQV0VcaJi7jeF1E8IpfMXmXcpq4r2kKyqpXk";
// ^ hash ^ parameters ^ salt ^ combined hash assert_eq!(expected, hash.to_string()); // The verifier reads the salt and the parameters from the hash and verifies the result is equal
Argon2::default().verify_password(password.as_bytes(), &hash).expect("invalid password");
# } Sometimes it may be necessary to support the verification of passwords that were hashed with different algorithms or parameters. This can be done using the traits in password_hash: # fn main() {
use password_hash::{PasswordHash, PasswordVerifier}; use argon2::Argon2;
use pbkdf2::Pbkdf2;
use scrypt::Scrypt; // Can be: `$argon2`, `$pbkdf2`, or `$scrypt`
let hash_string = "$argon2id$v=19$m=19456,t=2,p=1$YmFkIHNhbHQh$DqHGwv6NQV0VcaJi7jeF1E8IpfMXmXcpq4r2kKyqpXk";
let input_password = "password"; let password_hash = PasswordHash::new(&hash_string).expect("invalid password hash"); // Trait objects for algorithms to support
let algs: &[&dyn PasswordVerifier] = &[&Argon2::default(), &Pbkdf2, &Scrypt]; password_hash.verify_password(algs, input_password).expect("invalid password");
# }

