What purpose does salting passwords solve? To start, imagine that we use SHA-256 to hash our password: WARNING : DO NOT use SHA-256 as a password hashing algorithm. We use it in this example only because it is easy to understand. See the What should I use? section at the top of this page for better options. # fn main() {
# use sha2::{Sha256, Digest};
# use data_encoding::HEXLOWER;
let input = "password"; let mut hash = Sha256::new();
hash.update(input.as_bytes());
let result = hash.finalize(); println!("Hash: {}", HEXLOWER.encode(&result));
# } This prints 5e884898da..., which we would store in our database. Now some security event happens, and our database with all password hashes gets leaked. Now, the public has this information: +----------+------------+
| username | pw_sha256 |
+----------+------------+
| ferris | 5e884898da | <- note this hash
| curie | 437dd76609 |
| turing | fc3a03a63b |
+----------+------------+ An attacker is prepared, and has precalculated a table of common password hashes: +----------+------------+
| input | sha_256 |
+----------+------------+
| 1234 | 03ac674216 |
| abcd | 84e73dc50f |
| password | 5e884898da | <- note this hash
+----------+------------+ Bingo! user ferris has password hash 5e884898da, which means the password password will work to access ferris's account. The user is now compromised! This is a simple version of a rainbow attack. To prevent this, we do what is called "salting". This means that we pick a random salt that we store with the password in the database, and hash that salt with the input password when we want to check it: +----------+------------------------+
| username | pw |
+----------+------------------------+
| ferris | $sha2$salty$d878e396b9 | # user's password is 'password'
| curie | $sha2$spice$036ecfef69 |
| turing | $sha2$spice$701f72c284 |
| lovelace | $sha2$sugar$a92ec3b280 | # user's password is also 'password'
+----------+------------------------+ Notice how no hashes from the attacker's list appear in our new password table, and that even though two users have the same password, their hashes are different. This means that an attacker can no longer look up a hash directly, and instead has to waste time calculating each possible input! A salt function with SHA-256 would roughly look like: # fn main() {
# use sha2::{Sha256, Digest};
# use data_encoding::HEXLOWER;
// Input from the user
let input = "password"; // That user's salt, stored in the database
let salt = "salty";
let to_hash = format!("{salt}{input}"); // Compute salt+input hash
let mut hash = Sha256::new();
hash.update(to_hash.as_bytes());
let result = hash.finalize();
let digest = HEXLOWER.encode(&result); println!("Hash: {digest}"); // Hash of salt+password in the database
let stored_value = "d878e396b9";
assert_eq!(stored_value, &digest[..10]);
# } The PasswordHasher trait makes sure that salt is always used when hashing passwords.
